import React from 'react'
import './App.css'
import data from './list.json'

function List(){
    // console.log(data)
    return(
        // <h1>pawan</h1>
        data.map( movie => (
            <div className='row'>
            <div className='col-6 col-sm-4 col-md-3 col-xl-2 mb-3 mt-3 '>
              <div className='box '>
                <a href={movie.thumbnail_link}>
                  <img class=' mb-3' src={movie.thumbnail_link} alt={movie.movie_id}
                    style={{ borderRadius: 10, width: 150, height: 220 }} />
                </a>
                <h3 class='mb-1 text'>{movie.movie_name}</h3>
              </div>
            </div>
          </div>

            // <h6> {movie.movie_name} {movie.thumbnail_link}  </h6>
            ))
    )
}

export default List;
